        '<div class="para text-muted">\r\n    <small><p>\r\n        Hinweise: <br>\r\n        Einen Takt oder eine markierte Stelle anklicken, um die entsprechenden Textkritischen Anmerkungen anzuzeigen. <br>\r\n        Die gr\xf6sseren Boxen im Notentext markieren die jeweiligen Anschl\xfcsse der anderen Skizzen und sind ebenfalls verkn\xfcpft.\r\n    </p></small>\r\n</div>\r\n';
